import React from "react";
import Header from "./Header";
import Content from "./Content";
import Total from "./Total";
const Course = ({ course }) => {
  console.log(course);
  const headerElements = course.map((c) => <Header key={c.id} name={c.name} />);
  const contentElements = course.map((c) => (
    <Content key={c.parts.id} parts={c.parts} />
  ));
  const totalElements = course.map((c) => (
    <Total key={c.parts.id} parts={c.parts} />
  ));

  return (
    <>
      {headerElements}
      {contentElements}
      {totalElements}
    </>
  );
};

export default Course;
